window.bookSummaryJSON = "<p>Meet Braxton Smith in this new enemies to lovers romance.</p> <p>Dating the hot athlete? Yeah, been there, done that...</p> <p>Braxton Smith.</p> <p>Cessna University’s baseball captain.</p> <p>Naturally talented.</p> <p>Sinfully gorgeous.</p> <p>And exudes enough arrogance to fill a stadium.</p> <p>That same cocky attitude is what landed him in my anonymous gossip column.</p> <p>Believe me, I, Cara Gonzalez, don’t want anything to do with him.</p> <p>But he’s everywhere.</p> <p>In my class.</p> <p>In my dorm.</p> <p>In my mind.</p> <p>I left this type of drama back home.</p> <p>Transferring to Cessna University is my chance for a redo.</p> <p>And regardless of his rock-hard abs and panty-dropping smile.</p> <p>Arguing with an athlete isn’t one of my goals.</p> <p>My instincts betray me, though.</p> <p>This attraction feels different.</p> <p>Stronger.</p> <p>I have no choice but to stand my ground. </p> <p>Because this time, I’m afraid I’ll not only be hurt.</p> <p>I’ll end up gutted.</p> <p>Book one in the Cessna U Wildcats series, <i>Swinging Strike</i> is an enemy to lovers, standalone romance. If you like sexy, hot baseball players, buy Braxton Smith today.</p>"; 
